import React from 'react';
import {Navbar} from './navbar';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';

export class App extends React.Component {

  render() {
    return (
     <MuiThemeProvider>
     <div>
     <Navbar />
     <Search />
     </div>
     </MuiThemeProvider>
    );
  }
};
